import React from "react";
import "../styles/global.css";

const Home = () => {
  return (
    <div className="home">
      <h1>Hey there, I'm <span>Jose Chemmanoor</span></h1>
      <p className="animated-text">UI/UX Designer | Front-End Developer | Student</p>
      <button className="neon-btn" onClick={() => document.getElementById("about").scrollIntoView({ behavior: "smooth" })}>
        Get to Know More About Me
      </button>
    </div>
  );
};

export default Home;
